import React from 'react';
import { ButtonGroup, Button } from 'reactstrap';

const VisualizationType = ({ visualizationType, setVisualizationType }) => {
  const handleVisualizationChange = (type) => {
    setVisualizationType(type);
  };

  return (
    <div className="mb-3">
      <ButtonGroup>
        <Button
          color="primary"
          onClick={() => handleVisualizationChange('table')}
          active={visualizationType === 'table'}
        >
          Table
        </Button>
        <Button
          color="primary"
          onClick={() => handleVisualizationChange('graph')}
          active={visualizationType === 'graph'}
        >
          Graph
        </Button>
      </ButtonGroup>
    </div>
  );
};

export default VisualizationType;
